import React from "react";
import "bootstrap/dist/css/bootstrap.css";
import calendar from "./icons/calendar.png";
import { Link } from 'react-router-dom';


// Here, we display our Navbar
export default function Navbar() {

  const LoginButton = () => {
  return (
    <Link to="/login">
      <button>Go to Login</button>
    </Link>
    );
  };  

  return (
    <div class="container">
      <nav class="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between py-3 mb-4 border-bottom">
        <a href="/" class="d-flex align-items-center mb-3 mb-md-0 me-md-auto link-body-emphasis text-decoration-none">
          <img src={ calendar } class="bi me-2" width="40" height="40"/>
          <span class="fs-4">Minute Masters</span>
        </a>
        
      </nav>
    </div>
  );
}
